import React from "react";
import Footer from "../Footer";
import Header from "../header";

import service10 from "../../assets/images/resource/service-10.png";
import design1 from "../../assets/images/resource/design-1.png";
import design2 from "../../assets/images/resource/design-2.png";
import { Link } from "react-router-dom";

export default function CloudMigrationServices() {
  return (
    <>
      <div class="page-wrapper">
        <Header />
        <section class="top-container banner-section-five">
          <div class="auto-container">
            <div class="row clearfix">
              <div class="content-column col-lg-6 col-md-12 col-sm-12">
                <div class="inner-column">
                  <p
                    style={{
                      position: "relative",
                      fontStyle: "normal",
                      fontWeight: "400",
                      fontSize: "20px",
                      paddingBottom: "5px",
                      marginBottom: "20px",
                      color: "#212529",
                      marginTop: "0",
                    }}
                  >
                    <span
                      style={{
                        content: "",
                        width: "35px",
                        height: "2px",
                        position: "absolute",
                        bottom: "-4px",
                        left: 0,
                        background: "#2569e6",
                        WebkitTransform: "translateY(-50%)",
                        transform: "translateY(-50%)",
                      }}
                    />
                    Cloud Migrations
                  </p>
                  <h2>Migrate & Protect Your Data With Cloud Migration</h2>
                  <div class="text">
                  Optimize your migration needs with Tkxel's secure & cost-effective cloud migration services.
                  </div>
                  <a
                    href="#"
                    style={{ textDecoration: "none" }}
                    class="btn-style-one theme-btn"
                  >
                    Get a Proposal
                  </a>
                </div>
              </div>
              <div class="image-column col-lg-6 col-md-12 col-sm-12">
                <div class="inner-column">
                  <div class="image">
                    <img src={service10} alt="" />
                  </div>
                </div>
              </div>
            </div>
          </div>
        </section>

        <section class="stat-section cloudm-wrap"> 
        <div class="container"> <div class="stat-title"> <h2 class="home-heading-two">Why Cloud Migration with Tkxel?</h2> 
        </div> <div class="stat-wrapper"> <div class="stat-row"> <div class="stat-card c1"> 
        <img alt="Swift Migration" nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/cm-thunder-icon.svg" class=" lazyloaded" nitro-lazy-empty="" id="NTIyOjEyOQ==-1" src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/cm-thunder-icon.svg"/> 
        <h2 class="head">Swift Migration</h2> <p>With Tkxel's swift migration services, now you can get to your new cloud infrastructure faster and start realizing your ROI right away.</p> </div> <div class="stat-card c2"> <img alt="Cost Effective" nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/cm-dollar-icon.svg" class=" lazyloaded" nitro-lazy-empty="" id="NTI4OjEyNw==-1" src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/cm-dollar-icon.svg"/> 
        <h2 class="head">Cost Effective</h2> <p>Now cut your total cost of ownership by three times and also get a free pre-migration assessments by shifting to cloud infrastructure.</p> </div> </div> <div class="stat-row"> <div class="stat-card c3"> <img alt="Secure" nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/cm-group-icon.svg" class=" lazyloaded" nitro-lazy-empty="" id="NTM2OjExOA==-1" src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/cm-group-icon.svg"/> 
        <h2 class="head">Secure</h2> <p>We make sure that you have encrypted file transfers chain of custody of files and audit trails for easy reporting.</p> </div> <div class="stat-card c4"> <img alt="clock" nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/cm-clock-icon.svg" class=" lazyloaded" nitro-lazy-empty="" id="NTQyOjExNw==-1" src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/cm-clock-icon.svg"/> 
        <h2 class="head">Easy &amp; Flexible Deployment</h2> <p>Our qualified cloud professionals make your cloud migration process easy and flexible along with unlimited scalibility. Any file. Any platform. Any vendor.</p> </div> </div> </div> </div> </section>


        <section class="experties nitro-offscreen">
          {" "}
          <div class="container">
            <div class="exprt-title">
              {" "}
              <h2 class="home-heading-two">Services We Offer</h2>{" "}
            </div>
            <div class="exprt-row">
              {" "}
              <div class="exprt-column">
                {" "}
                <div class="card c-typ3">
                  {" "}
                  <div class="card-title">
                    {" "}
                    <img
                      alt="Tech Support"
                      nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-tech-support.svg"
                      class=" lazyloaded"
                      nitro-lazy-empty=""
                      id="NTYyOjEyNw==-1"
                      src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-tech-support.svg"
                    />
                    <h4>Tech Support</h4>{" "}
                  </div>{" "}
                  <p>
                    Efficient and quick solutions for your customer’s technical
                    conundrums.
                  </p>{" "}
                </div>{" "}
              </div>{" "}
            </div>{" "}
            <div class="exprt-row m-center">
              {" "}
              <div class="exprt-column">
                {" "}
                <div class="card c-typ1">
                  {" "}
                  <div class="card-title">
                    {" "}
                    <img
                      alt="Tech Solutions"
                      nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-tech-solutions.svg"
                      class=" lazyloaded"
                      nitro-lazy-empty=""
                      id="NTczOjEzMQ==-1"
                      src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-tech-solutions.svg"
                    />
                    <h4>Tech Solutions</h4>{" "}
                  </div>{" "}
                  <p>
                    Specialized software development to improve efficiency of
                    workflows.
                  </p>{" "}
                </div>{" "}
                <div class="card c-typ1">
                  {" "}
                  <div class="card-title">
                    {" "}
                    <img
                      alt="Form Processing"
                      nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-form-processing.svg"
                      class=" lazyloaded"
                      nitro-lazy-empty=""
                      id="NTgwOjEzMw==-1"
                      src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-form-processing.svg"
                    />
                    <h4>Form Processing</h4>{" "}
                  </div>{" "}
                  <p>
                    Including customer surveys, requests, complaints, and
                    others.
                  </p>{" "}
                </div>{" "}
              </div>{" "}
              <div class="exprt-column">
                {" "}
                <div class="c-type-img">
                  {" "}
                  <img
                    alt="what we offer"
                    nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/what-we-offer.webp"
                    class=" lazyloaded"
                    nitro-lazy-empty=""
                    id="NTg4OjEyMg==-1"
                    src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/what-we-offer.webp"
                  />{" "}
                </div>{" "}
              </div>{" "}
              <div class="exprt-column">
                {" "}
                <div class="card c-typ2">
                  {" "}
                  <div class="card-title">
                    {" "}
                    <img
                      alt="Telemarketing"
                      nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-telemarketing.svg"
                      class=" lazyloaded"
                      nitro-lazy-empty=""
                      id="NTk0OjEyOQ==-1"
                      src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-telemarketing.svg"
                    />{" "}
                    <h4>Telemarketing</h4>{" "}
                  </div>{" "}
                  <p>Inbound and outbound to suit your prospecting demands.</p>{" "}
                </div>{" "}
                <div class="card c-typ2">
                  {" "}
                  <div class="card-title">
                    {" "}
                    <img
                      alt="IT HelpDesk"
                      nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-it-helpdesk.svg"
                      class=" lazyloaded"
                      nitro-lazy-empty=""
                      id="NjAxOjEyNQ==-1"
                      src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-it-helpdesk.svg"
                    />
                    <h4>IT HelpDesk</h4>{" "}
                  </div>{" "}
                  <p>
                    Addressing customer queries and enhancing their experience.
                  </p>{" "}
                </div>{" "}
              </div>{" "}
            </div>{" "}
            <div class="exprt-row">
              {" "}
              <div class="exprt-column">
                {" "}
                <div class="card c-typ1">
                  {" "}
                  <div class="card-title">
                    {" "}
                    <img
                      alt="Image Processing"
                      nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-image-processing.svg"
                      class=" lazyloaded"
                      nitro-lazy-empty=""
                      id="NjEyOjEzNQ==-1"
                      src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-image-processing.svg"
                    />
                    <h4>Image Processing</h4>{" "}
                  </div>{" "}
                  <p>
                    Manual and custom software options for real time processing.
                  </p>{" "}
                </div>{" "}
              </div>{" "}
              <div class="exprt-column">
                {" "}
                <div class="card c-typ2">
                  {" "}
                  <div class="card-title">
                    {" "}
                    <img
                      alt="Data Entry"
                      nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-data-entry.svg"
                      class=" lazyloaded"
                      nitro-lazy-empty=""
                      id="NjIxOjEyMw==-1"
                      src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-data-entry.svg"
                    />{" "}
                    <h4>Data Entry</h4>{" "}
                  </div>{" "}
                  <p>
                    Storing and Managing data and in secure states for later
                    processing.
                  </p>{" "}
                </div>{" "}
              </div>{" "}
            </div>{" "}
          </div>{" "}
        </section>

        <section className="rtt-section">
          <div className="container text-btn">
            <h2 className="home-heading-two">
              Let's co-create the right IT solution for your business.
            </h2>
            <a className="custo-btn" id="stylebtn">
              Let's Talk
            </a>
          </div>
        </section>
        <section class="nitro-offscreen">
          <div class="container bpo-proc">
            <div class="bpo-title">
              <h2 class="home-heading-two">Our BPO Process</h2>{" "}
            </div>{" "}
            <div class="bpo-steps">
              <div class="bpo-step">
                {" "}
                <div class="bpo-prog">
                  {" "}
                  <span>1</span>
                  <img
                    alt="ARROW"
                    nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/dashed-arrow.svg"
                    class=" lazyloaded"
                    nitro-lazy-empty=""
                    id="NjQ3OjEyMA==-1"
                    src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/dashed-arrow.svg"
                  />
                </div>{" "}
                <h4>Requirement Gathering</h4>{" "}
              </div>{" "}
              <div class="bpo-step">
                {" "}
                <div class="bpo-prog">
                  {" "}
                  <span>2</span>{" "}
                  <img
                    alt="ARROW"
                    nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/dashed-arrow.svg"
                    class=" lazyloaded"
                    nitro-lazy-empty=""
                    id="NjU0OjEyMA==-1"
                    src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/dashed-arrow.svg"
                  />
                </div>{" "}
                <h4>Team Selection</h4>{" "}
              </div>{" "}
              <div class="bpo-step">
